import React from "react";

function Cards(props) {
  const cards = props.cards;
  return (
    <div className="cards">
      <h2>Group projects </h2>
      {cards.map((cards) => (
        <h3>{cards.name}</h3>
      ))}
    <br/>
    </div>
  );
}

export default Cards;
